use base64::{decode, DecodeError};
use polywrap_core::file_reader::SimpleFileReader;
use polywrap_wasm::{wasm_package::WasmPackage, wasm_wrapper::WasmWrapper};
use std::sync::Arc;

fn wrap_wasm() -> Result<Vec<u8>, DecodeError> {
    decode(
        ""
    )
}

fn wrap_info() -> Result<Vec<u8>, DecodeError> {
    decode(
        ""
    )
}

pub fn wasm_package() -> WasmPackage {
    WasmPackage::new(
        Arc::new(SimpleFileReader::new()),
        wrap_info().ok(),
        wrap_wasm().ok(),
    )
}

pub fn wasm_wrapper() -> WasmWrapper {
    WasmWrapper::new(wrap_wasm().unwrap(), Arc::new(SimpleFileReader::new()))
}
